import React from "react";
import { Container } from "react-bootstrap";
import { Row } from "react-bootstrap";
import { Col } from "react-bootstrap";
import 'bootstrap/dist/css/bootstrap.min.css';
import '../App.css';
import { Card } from "react-bootstrap";
import { UserDetails } from "./UserDetails- new";
import { NavLink } from "react-router-dom";

export class Search extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
            username : '',
            gitHubUserFound: false,
            gitLabUserFound: false,

            gitHubUser: {},
            gitLabUser: {},
            gitRepos: [],


        };
        this.handleSubmit = this.handleSubmit.bind(this);
       // this.handleClick = this.handleClick.bind(this);
        this.onChangeUsername = this.onChangeUsername.bind(this);

    }

    onChangeUsername(e) {this.setState({username: e.target.value})}

    //pass in a handler as props that feeds the user info back to the parent

    // handleClick(e) {



    //     window.open(
    //         `/gitHubUser`, //change this to user profile route for github or gitlab
    //         '_blank' 
    //       );
    // }


    async handleSubmit(e) {

        e.preventDefault();


        let githubapi = '/github/' + this.state.username;
        let gitlabapi = '/gitlab/' + this.state.username;

        try {
            fetch(githubapi)
                .then(res => res.json())
                .then(
                    (result) => {
                        if ('message' in result){
                            console.log(result.message)
                        }
                        else {
                        this.setState({
                          gitHubUser: result,
                          gitHubUserFound: true

                        }) 
                        console.log(result)
                    }

                    },
                    (error) => {
                      console.log(error)
                    }
                )
            } catch {
                this.setState({gitHubUserFound: false});
                console.log('No gitHub user found');
            }

            try {
                fetch(gitlabapi)
                    .then(res => res.json())
                    .then(
                        (result) => {
                            if ('message' in result){
                                console.log(result.message)
                            }else {
                            this.setState({
                              gitLabUser: result,
                              gitLabUserFound: true
                            }) 
                            console.log(result.name)
                            }  }   
                    )
                        }catch {
                    this.setState({gitLabUserFound: false});
                    console.log('No gitLab user found');
                }

        this.props.handleSearchResults(this.state.username, "Hello")





    }




    render () {
        return (
            <div className="main">  
                <Container className="search">

                    <Row>
                        <h2 className="text-center">Enter a username </h2>
                        <p>you entered username {this.state.username}</p>
                        <p>We found the following user on gitHub: {this.state.gitHubUser.name}</p>
                        <p>This is a props test {this.props.userMessage}</p>
                    </Row>
                    <Row>
                        <form className='text-center' onSubmit={this.handleSubmit}>
                            <input className="search-bar" type="text" name="username" id="username" onChange={this.onChangeUsername}></input>
                            <input type="submit" value="Search!"  className="btn-internal"></input>
                        </form>
                    </Row>
                    <Row className="search-results text-center">

                        <Col></Col>

                        <Card style={{ width: '18rem' }} className="text-center">

                            <Card.Img className="search-img" variant="top" src={this.state.gitLabUser.avatar_url} />
                            <Card.Body>
                                    <Card.Title>GitLab: {this.state.gitLabUser.name} </Card.Title>
                                    <Card.Text>
                                        {null}
                                    </Card.Text>
                                    <NavLink to="/gitLabUser"><button  className="btn-internal">See user info</button></NavLink>
                                </Card.Body>
                        </Card>

                        <Card style={{ width: '18rem' }} className="text-center">

                            <Card.Img className="search-img" variant="top" src={this.state.gitHubUser.avatar_url}  alt="..."  />
                            <Card.Body>
                                    <Card.Title>GitHub:</Card.Title>
                                    <Card.Text>
                                    {this.state.gitHubUser.name} <br />
                                    {this.state.gitHubUser.bio}
                                    </Card.Text>
                                    <NavLink to="/gitHubUser"><button  className="btn-internal">See user info</button></NavLink>
                            </Card.Body>
                        </Card>
                        <Col></Col>





                    </Row>




                </Container>
            </div>

        )
    }


}
